import React from 'react'

function RenderingLists() {
    const bookList = [
        'to kill a mocking bird',
        'the great gatsby',
        'the catcher in the rye',
    ]
  return (
    <div>
        {bookList.map}
    </div>
  )
}

export default RenderingLists
